$eyeB64    = ""
$pigeonB64 = ""

$pngEye = [System.Convert]::FromBase64String($eyeB64)
$icoPigeon = [System.Convert]::FromBase64String($pigeonB64)

$syncHash = [hashtable]::Synchronized(@{})
$reader = (New-Object System.Xml.XmlNodeReader $xaml)
$syncHash.window = [Windows.Markup.XamlReader]::Load($reader)
$syncHash.Gui = @{}

$xaml.SelectNodes("//*[@*[contains(translate(name(.),'n','N'),'x:Name')]]") | ForEach-Object {
    if(!($_ -match "ColorAnimation" -or $_ -match "ThicknessAnimation")) {
        $syncHash.Gui.Add($_.Name, $syncHash.Window.FindName($_.Name)) 2>&1 3>&1 4>&1 | Out-Null
    }
}

$syncHash.window.add_Loaded({
    $syncHash.window.Icon = $icoPigeon
})

$syncHash.Gui.btEyePng.source  = $pngEye
$syncHash.Gui.icoPigeon.source = $icoPigeon
$syncHash.Gui.tbCount.text = $syncHash.Gui.tbOutput.text.Length.ToString()

$syncHash.awake = {
    $syncHash.wsh.SendKeys('+{F15}')
}

#Timer for awake
$syncHash.timer_awake = new-object System.Windows.Threading.DispatcherTimer(1) # lowest priority

# Setup timer and callback for awake
$syncHash.Window.Add_SourceInitialized({            
    $syncHash.timer_awake.Interval = [TimeSpan]"0:3:0.00"
    $syncHash.timer_awake.Add_Tick( $syncHash.awake )
    $syncHash.timer_awake.Start()
})

$handler_keypress = {
    [string]$key = ($_.key).ToString()
    if($key -match "Escape"){
        if($syncHash.Gui.ppAbout.IsOpen){
            $syncHash.Gui.ppAbout.IsOpen = $false
            return
        }
    }
}
$syncHash.Window.add_KeyDown($handler_keypress)

$syncHash.Gui.gTitle.Add_MouseDown({
    $e = [System.Windows.Input.MouseButtonEventArgs]$args[1]

    if ( $e.LeftButton -eq [System.Windows.Input.MouseButtonState]::Pressed ){
        $syncHash.window.DragMove()
    }
})

$syncHash.Gui.btEye.Add_MouseDown({
    $e = [System.Windows.Input.MouseEventArgs]$args[1]

    if ( $e.RightButton -eq [System.Windows.Input.MouseButtonState]::Pressed ) {
        $syncHash.Gui.pbPassPhrase.IsEnabled = $false
        $syncHash.Gui.pbPassPhrase.Visibility = [System.Windows.Visibility]::Hidden
        $syncHash.Gui.tbPassPhrase.IsEnabled = $true
        $syncHash.Gui.tbPassPhrase.Visibility = [System.Windows.Visibility]::Visible
        $syncHash.Gui.tbPassPhrase.Text = $syncHash.Gui.pbPassPhrase.Password
    }
})

$syncHash.Gui.btEye.Add_MouseUp({
    $e = [System.Windows.Input.MouseEventArgs]$args[1]

    if ( $e.RightButton -eq [System.Windows.Input.MouseButtonState]::Released ) {
        $syncHash.Gui.tbPassPhrase.Text = ""
        $syncHash.Gui.pbPassPhrase.IsEnabled = $true
        $syncHash.Gui.pbPassPhrase.Visibility = [System.Windows.Visibility]::Visible
        $syncHash.Gui.tbPassPhrase.IsEnabled = $false
        $syncHash.Gui.tbPassPhrase.Visibility = [System.Windows.Visibility]::Hidden
    }
})

$syncHash.Gui.btExit.Add_Click({
    $syncHash.Window.close()
})

$source =  @"
using System;
using System.Runtime.InteropServices;

public static class NativeMethods
{

    [DllImport("KERNEL32.DLL", EntryPoint = "RtlZeroMemory")]
    public static extern bool ZeroMemory(IntPtr Destination, int Length);
}
"@
Add-Type -TypeDefinition $Source

Function EncryptToBase64([string]$pText, [string]$mima)
{
    $tBytes = [System.Text.Encoding]::UTF8.GetBytes($pText)
    [byte[]]$tHash = [System.Security.Cryptography.MD5]::Create().ComputeHash($tBytes)
    [System.Security.Cryptography.SymmetricAlgorithm]$mm = [System.Security.Cryptography.Aes]::Create()
    $mm.Key = [System.Security.Cryptography.MD5]::Create().ComputeHash([System.Text.Encoding]::UTF8.GetBytes($mima))
    $mm.IV  = [byte[]]::new(16)
    [System.IO.MemoryStream]$ms = New-Object System.IO.MemoryStream
    [System.Security.Cryptography.CryptoStream]$cryptoStream = New-Object System.Security.Cryptography.CryptoStream($ms, $mm.CreateEncryptor(), [System.Security.Cryptography.CryptoStreamMode]::Write)
    $cryptoStream.Write($tBytes, 0, $tBytes.Length)
    $cryptoStream.Write($tHash,  0, $tHash.Length)
    $cryptoStream.FlushFinalBlock()
    return [System.Convert]::ToBase64String($ms.ToArray())
}

$syncHash.Gui.btEncrypt.Add_Click({
    [string]$password = $syncHash.Gui.pbPassPhrase.Password;
    if ([string]::IsNullOrEmpty($password))
    {
        [Windows.MessageBox]::Show("PassPhrase is empty!", "Pigeon Alert", 'Ok', 'Error')
        return
    }
    if ([string]::IsNullOrEmpty($syncHash.Gui.tbOutput.text))
    {
        [Windows.MessageBox]::Show("Nothing to encrypt!", "Pigeon Alert", 'Ok', 'Error')
        return
    }
    [System.Runtime.InteropServices.GCHandle]$gch = [System.Runtime.InteropServices.GCHandle]::Alloc($password, [System.Runtime.InteropServices.GCHandleType]::Pinned);
    $b64 = EncryptToBase64 $syncHash.Gui.tbOutput.text $password
    [NativeMethods]::ZeroMemory($gch.AddrOfPinnedObject(), $password.Length * 2)
    $gch.Free()
    $syncHash.Gui.tbOutput.text = $b64
})

Function IsBase64String([string]$base64)
{
    try { $null=[System.Convert]::FromBase64String($base64); $true } catch { $false }
}

Function DecryptFromBase64([string]$eText, [string]$mima)
{
    [byte[]]$eBytes = [System.Convert]::FromBase64String($eText)
    [System.Security.Cryptography.SymmetricAlgorithm]$mm = [System.Security.Cryptography.Aes]::Create()
    $mm.Key = [System.Security.Cryptography.MD5]::Create().ComputeHash([System.Text.Encoding]::UTF8.GetBytes($mima))
    $mm.IV = [byte[]]::new(16)
    [System.IO.MemoryStream]$ms = New-Object System.IO.MemoryStream
    [System.Security.Cryptography.CryptoStream]$cs = New-Object System.Security.Cryptography.CryptoStream($ms, $mm.CreateDecryptor(), [System.Security.Cryptography.CryptoStreamMode]::Write)
    $cs.Write($eBytes, 0, $eBytes.Length)
    $cs.FlushFinalBlock();
    [byte[]]$pBytes = $ms.ToArray()
    [int]$pLen = $pBytes.Length - 16
    if ($pLen -lt 0){
        return "Invalid Length, no hash found!"
    }
    $pHash = [byte[]]::new(16)
    [System.Array]::Copy($pBytes, $pLen, $pHash, 0, 16)
    [byte[]]$dHash = [System.Security.Cryptography.MD5]::Create().ComputeHash($pBytes, 0, $pLen)
    $diff = Compare-Object $pHash $dHash
    if ($null -ne $diff){
        return "Invalid Hash!"
    }
    return [System.Text.Encoding]::UTF8.GetString($pBytes, 0, $pLen)
}

$syncHash.Gui.btDecrypt.Add_Click({
    if ([string]::IsNullOrEmpty($syncHash.Gui.tbOutput.Text))
    {
        [Windows.MessageBox]::Show("Nothing to decrypt!", "Pigeon Alert", 'Ok', 'Error')
        return
    }
    [bool]$testB64 = IsBase64String $syncHash.Gui.tbOutput.Text
    if (!$testB64)
    {
        [Windows.MessageBox]::Show("Not a valid Base64 encoded string!", "Pigeon Alert", 'Ok', 'Error')
        return
    }
    [string]$password = $syncHash.Gui.pbPassPhrase.Password
    if ([string]::IsNullOrEmpty($password))
    {
        [Windows.MessageBox]::Show("PassPhrase is empty!", "Pigeon Alert", 'Ok', 'Error')
        return
    }
    [System.Runtime.InteropServices.GCHandle]$gch = [System.Runtime.InteropServices.GCHandle]::Alloc($password, [System.Runtime.InteropServices.GCHandleType]::Pinned)
    [string]$plainText = DecryptFromBase64 $syncHash.Gui.tbOutput.Text $password
    [NativeMethods]::ZeroMemory($gch.AddrOfPinnedObject(), $password.Length * 2)
    $gch.Free()
    $syncHash.Gui.tbOutput.Text = $plainText
})

$syncHash.Gui.btCopy.Add_Click({
    if ($syncHash.Gui.tbOutput.Text.Length -eq 0) {
        [Windows.MessageBox]::Show("Nothing to copy!", "Pigeon Alert", "Ok", "Error")
        return
    }
    $syncHash.Gui.tbOutput.Focusable = $true
    [System.Windows.Input.Keyboard]::Focus($syncHash.Gui.tbOutput)
    $syncHash.Gui.tbOutput.SelectAll()
    [System.Windows.Clipboard]::SetText($syncHash.Gui.tbOutput.Text)
})

$syncHash.Gui.btClear.Add_Click({
    $syncHash.Gui.tbOutput.text = ""
})

$syncHash.Gui.btPaste.Add_Click({
    $temp = [System.Windows.Clipboard]::GetText()
    if(![string]::IsNullOrEmpty($temp)){
        $syncHash.Gui.tbOutput.text = $temp
    }
})

$syncHash.Gui.tbOutput.Add_textChanged({
    [int]$len = $syncHash.Gui.tbOutput.text.Length
    if($len -gt 1048576){
        [Windows.MessageBox]::Show("The number of characters exceeds the limit (1024K), the performance will be decreased.", "Pigeon Alert", "Ok", "Error")
    }
    $syncHash.Gui.tbCount.text = $len.ToString()
})

$syncHash.Gui.btAbout.Add_Click({
    if($syncHash.Gui.ppAbout.IsOpen){
        $syncHash.Gui.ppAbout.IsOpen = $false
    } else {
        $syncHash.Gui.ppAbout.IsOpen = $true
    }
})

